import React, { useState } from 'react';

import axios from 'axios'

import { Container, FormContainer, RegisterForm } from './styles';
import FormGroup from '../../Components/Form-Group'


function Cadastro() {

  const [nameValue, setNameValue] = useState(null)
  const [loginValue, setLoginValue] = useState(null)
  const [passwordValue, setPasswordValue] = useState(null)

  const params = {
    id: 3,
    name: "João",
    login: "joao123",
    password: "1234"
  }

  function checkData() {

  }

  function register() {
    axios.post('http://localhost:5000/users', params)
  }

  return (
    <Container>
        <FormContainer>
            <RegisterForm>
                <FormGroup setValueFunction={setNameValue} label="Nome" type="text" placeholder="Nome" id="register-name" /> 
                <FormGroup setValueFunction={setLoginValue} label="Login" type="text" placeholder="Login" id="register-login" /> 
                <FormGroup setValueFunction={setPasswordValue} label="Senha" type="password" placeholder="Senha" id="register-password" />
                <button type="button" onClick={register}>Cadastrar</button>
            </RegisterForm>
            <a href="#">Já tem uma conta? Entre</a>
        </FormContainer>
    </Container>
  )
}

export default Cadastro;
